import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import MainPage from './pages/main';
import AboutMe from './pages/aboutMe';
import Career from './pages/main';
import Certification from './pages/main';
import {BrowserRouter, Switch, Route} from 'react-router-dom';
import reportWebVitals from './reportWebVitals';

const PagNotFound = () => (<div>PÃ¡gina 404</div>);

ReactDOM.render(
  <BrowserRouter>
    <Switch>
      <Route path="/home" component={MainPage} exact />
      <Route path="/about-me" component={AboutMe} exact />
      <Route path="/career" component={Career} exact />
      <Route path="/certification" component={Certification} exact />
      <Route component={PagNotFound} />
    </Switch>
  </BrowserRouter>,
  document.getElementById('root')
);

reportWebVitals();
